n\n    explained_variance , singular_values = client.persist(cpt)\n    #arrays.validate_contract()   \n    explained_variance , singular_values = client.compute([explained_variance ,singular_values])\n    print(\"explained_variance ,singular_values\",explained_variance.result() ,\" and \" , singular_values.result(), flush=True )\n\nprint(\"Done in \", time.time() -t , \" secondes\")\n    \nos.remove('data.h5') \nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"label":{"value":"write"},"renderers":[{"id":"1340"}]},"id":"1363","type":"LegendItem"},{"attributes":{"format":"0.0b"},"id":"1366","type":"NumeralTickFormatter"},{"attributes":{"coordinates":null,"formatter":{"id":"1495"},"group":null,"major_label_policy":{"id":"1496"},"ticker":{"id":"1379"}},"id":"1378","type":"DatetimeAxis"},{"attributes":{"below":[{"id":"1378"}],"center":[{"id":"1381"},{"id":"1385"}],"height":150,"left":[{"id":"1382"}],"renderers":[{"id":"1397"}],"sizing_mode":"stretch_both","title":{"id":"1369"},"toolbar":{"id":"1389"},"toolbar_location":"above","x_range":{"id":"1215"},"x_scale":{"id":"1374"},"y_range":{"id":"1372"},"y_scale":{"id":"1376"}},"id":"1368","subtype":"Figure","type":"Plot"},{"attributes":{"axis":{"id":"1296"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"1299","type":"Grid"},{"attributes":{},"id":"1383","type":"BasicTicker"},{"attributes":{},"id":"1161","type":"CategoricalScale"},{"attributes":{},"id":"1290","type":"LinearScale"},{"attributes":{"line_alpha":0.1,"line_color":"#1f77b4","x":{"field":"time"},"y":{"field":"num_fds"}},"id":"1395","type":"Line"},{"attributes":{"bottom":{"field":"bottom"},"fill_alpha":{"value":0.2},"fill_color":{"field":"color"},"hatch_alpha":{"value":0.2},"hatch_color":{"field":"color"},"left":{"field":"left"},"line_alpha":{"value":0.2},"line_width":{"value":2},"right":{"field":"right"},"top":{"field":"top"}},"id":"1033","type":"Quad"},{"attributes":{"fill_color":{"value":"blue"},"hat
